import { View, Text } from "react-native";
import React, { useEffect } from "react";
// import SelectDropdown from "react-native-material-dropdown";

const Home = () => {
    console.log("in home");
    const fetchData = () => {
        const baseURL = "https://localhost:7162/api/Elevators";
        axios
            .get(`${baseURL}`)
            .then((response) => {
                console.log(response.data);
            })
            .catch((err) => console.log("we have an error:", err));
    };

    useEffect(() => {
        fetchData();
    }, []);

    return <View style={{ backgroundColor: "red" }}></View>;
};

export default Home;
